# Compute modular inverse of e
def egcd(a, gcd):
    d,y, u,v = 0,1, 1,0
    while a != 0:
        q, r = gcd//a, gcd%a
        m, n = d-u*q, y-v*q
        gcd,a, d,y, u,v = a,r, u,v, m,n
    return gcd, d, y

